import React from 'react';
import { BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import './index.css';
import 'tachyons';
import lockonebackground from './assets/y-so-serious-white.png';
import { Lockone } from './components/pages/Lockone';
import { Locktwo } from './components/pages/Locktwo'

function App() {
  return (
    <React.Fragment>
      <Router>
        <Switch>
          <Route style={{ backgroundImage: "url(" + lockonebackground + ")"}} exact path="/" component={Lockone} />
          <Route exact path="/locktwo" component={Locktwo} />
        </Switch>
      </Router>
    </React.Fragment>
  );
}

export default App;
